package com.wetour.we_t.ui.makeTour.selectTourLocation

import android.content.Intent
import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import android.view.View
import androidx.recyclerview.widget.LinearLayoutManager
import com.wetour.we_t.R
import com.wetour.we_t.data.PlaceData
import com.wetour.we_t.data.SelectTourLocationData
import kotlinx.android.synthetic.main.activity_select_tour_location.*

class SelectTourLocationActivity : AppCompatActivity(), View.OnClickListener {

    private val RESULT_CODE = 200

    lateinit var selectTourLocationAdapter: SelectTourLocationAdapter
    lateinit var parentsLikeLocationAdapter: ParentsLikeLocationAdapter
    var placeData = mutableListOf<SelectTourLocationData>()
    var parentsLikeData = mutableListOf<PlaceData>()

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_select_tour_location)

        setAdapter()
        getData()
    }

    override fun onClick(v: View?) {
        when (v?.id) {
            R.id.act_select_tour_location_btn_close -> finish()
        }
    }

    private fun setAdapter() {
        selectTourLocationAdapter = SelectTourLocationAdapter(this,
            object : SelectTourLocationAdapter.OnClickSelectPlace {
                override fun selectPlace(position: Int) {
                    val intent = Intent()
                    intent.putExtra("place", selectTourLocationAdapter.datas[position].placeName)
                    setResult(RESULT_CODE, intent)
                    finish()
                }
            })

        parentsLikeLocationAdapter = ParentsLikeLocationAdapter(this,
            object : ParentsLikeLocationAdapter.OnClickListener {
                override fun onClickParentsLikePlace(position: Int) {
                    val intent = Intent()
                    intent.putExtra("place", parentsLikeLocationAdapter.datas[position].name)
                    setResult(RESULT_CODE, intent)
                    finish()
                }

            })

        act_select_tour_location_place_recyclerview.adapter = selectTourLocationAdapter

        act_select_tour_location_place_recyclerview.layoutManager =
            LinearLayoutManager(this, LinearLayoutManager.VERTICAL, false)

        act_select_tour_location_parent_recyclerview.adapter = parentsLikeLocationAdapter

        act_select_tour_location_parent_recyclerview.layoutManager =
            LinearLayoutManager(this, LinearLayoutManager.HORIZONTAL, false)

    }

